style.css:
/* Apply dark background and white text to the body */
body {
    background-color: #121212 !important;
    color: #ffffff !important;
}

/* Apply dark background and white text to common elements */
div, span, header, footer, section, article, nav, aside {
    background-color: #121212 !important;
    color: #ffffff !important;
}

/* Change link colors */
a {
    color: #1E90FF !important;
}

/* Apply dark background and white text to form elements */
input, textarea, button, select {
    background-color: #333333 !important;
    color: #ffffff !important;
    border-color: #555555 !important;
}

/* Apply dark background and white text to tables */
table, th, td {
    background-color: #121212 !important;
    color: #ffffff !important;
    border-color: #333333 !important;
}

/* Apply dark borders to elements with borders */
* {
    border-color: #333333 !important;
}
